import React, {useEffect} from 'react';
import placeholderApi from '../../common/apis/placeholderApi';
import {useDispatch} from 'react-redux';
import {addUsers} from '../../features/users/usersSlice';

const AlbumsUser = () => {
   // const dispatch = useDispatch();
    useEffect(()=>{
        const fetchUsersList = async () => {
          const response = await placeholderApi.get(`users`)
            .catch((error)=>{
                console.log(error);
            });
            console.log("The Response from the API: ",response);
          //  dispatch(addUsers(response.data));
        }
        fetchUsersList();
    },[]);
  return (
    <div>AlbumsUserList</div>
  )
}

export default AlbumsUser
